<p><a id="TAB1"></a></p>

<p><span style="font-family:arial,helvetica,sans-serif;"><font size="4" style="font-size: 14pt">2) Introduction</font></span></p>

<p align="left" style="line-height: 150%"><span style="font-family:arial,helvetica,sans-serif;"><font size="3" style="font-size: 12pt">The Unified Forecast System (UFS) is a community-based, coupled, comprehensive Earth modeling system. The UFS numerical applications span local to global domains and predictive time scales from sub-hourly analyses to seasonal predictions. It is designed to support the <a href="https://www.weather.gov/about/weather-enterprise">Weather Enterprise </a>and to be the source system for <a href="http://www.noaa.gov/">NOAA's</a> operational numerical weather prediction applications. </font></span></p>

<p style="line-height: 150%"><span style="font-family:arial,helvetica,sans-serif;"><font size="3" style="font-size: 12pt">NOAA is the agency tasked with providing the official weather and climate forecasts and warnings in the United States. First and foremost, the UFS provides a framework to engage the extensive research enterprise in the US. It creates an environment to more efficiently and effectively translate research advances into operational outcomes. The UFS also enables NOAA to simplify its production suite of forecasting models from a great many independent systems, each of which has to be improved and maintained, to a single seamless system.</font></span></p>

<p style="line-height: 150%"><span style="font-family:arial,helvetica,sans-serif;"><font size="3" style="font-size: 12pt">The UFS community includes researchers, developers and users from NOAA, educational institutions, federal agencies, and the private sector. The UFS supports research and development in the community and accelerates the transition of research successes to operations.</font></span></p>

<p style="line-height: 150%"><span style="font-family:arial,helvetica,sans-serif;"><font size="3" style="font-size: 12pt">UFS applications share numerical forecast system elements, including Earth-system model components (e.g. atmosphere, ocean, sea ice, land, chemistry, etc.), observation processing, pre-processing, data assimilation, forward forecasting, ensemble and probabilistic processing, and post-processing. The applications share infrastructure such as model coupling tools and workflow software.</font></span></p>

<p style="line-height: 150%"><span style="font-family:arial,helvetica,sans-serif;"><font size="3" style="font-size: 12pt">Comprehensive and updated news on the Unified Forecast System can be found on the <a href="http://www.weather.gov/exit?url=https://ufscommunity.org/">UFS community</a> web page.</font></span></p>

<p><a id="TAB2"></a></p>

<p><span style="font-family:arial,helvetica,sans-serif;"><font size="4" style="font-size: 14pt">3) UFS at the NWS</font></span></p>

<p style="font-weight: normal; line-height: 150%"><span style="font-family:arial,helvetica,sans-serif;"><font size="3" style="font-size: 12pt">The NWS Research to Operations (R2O) initiative's five year plan is to upgrade the current operational Global Forecast System (GFS) to run as a unified, fully coupled Next Generation Global Prediction System (NGGPS) within NEMS (NOAA Environmental Modeling System) infrastructure. Using advanced high performance computing architectures, the system will incorporate the most recent advances in weather prediction modeling from NOAA and the research community.</font></span></p>

<ul>
	<li>
	<p style="margin-bottom: 0in; line-height: 150%"><span style="font-family:arial,helvetica,sans-serif;"><span style="font-size:14px;">Implement a weather-scale, fully-coupled NWP System</span></span></p>
	</li>
	<li>
	<p style="margin-bottom: 0in; line-height: 150%"><span style="font-family:arial,helvetica,sans-serif;"><span style="font-size:14px;">Extend forecast skill beyond 8 to 10 days</span></span></p>
	</li>
	<li>
	<p style="margin-bottom: 0in; line-height: 150%"><span style="font-family:arial,helvetica,sans-serif;"><span style="font-size:14px;">Improve hurricane track and intensity forecast</span></span></p>
	</li>
	<li>
	<p style="margin-bottom: 0in; line-height: 150%"><span style="font-family:arial,helvetica,sans-serif;"><span style="font-size:14px;">Extend weather forecasting to 30 days</span></span></p>
	</li>
	<li>
	<p style="line-height: 150%"><span style="font-size:14px;"><span style="font-family:arial,helvetica,sans-serif;">Implement the unified next generation model in regional applications (Rapidly Refreshed Convective-Allowing Ensemble Forecast system, Regional Nested Hurricane Forecast System)</span></span></p>
	</li>
	<li>
	<p style="line-height: 150%"><span style="font-size:14px;"><span style="font-family:arial,helvetica,sans-serif;">For further details see the <a href="http://www.weather.gov/exit?url=https://ufscommunity.org/#/science/index">Applications Plan</a> on the UFS community web site.</span></span></p>
	</li>
</ul>

<p style="line-height: 150%"><br>
<img alt="" src="data:image/png;base64,"></p>

<p><a id="TAB3"></a></p>

<p><span style="font-family:arial,helvetica,sans-serif;"><font size="4" style="font-size: 14pt">4) UFS at NCEP : Global Modeling Systems</font></span></p>

<p align="left" style="margin-bottom: 0in; line-height: 150%"><span style="font-family:arial,helvetica,sans-serif;"><font size="3" style="font-size: 12pt">In 2017 the <a href="https://www.gfdl.noaa.gov/fv3/">Finite Volume Cubed Sphere (FV3)</a> dynamical core, developed at NOAAs Geophysical Fluid Dynamics Laboratory, was selected for the new NGGPS/UFS atmospheric model for both global and regional scales. At NCEP, the FV3 dynamical core implementation includes incorporating FV3 into NEMS, and developing advanced physics and data assimilation techniques to match or exceed the skill of operational Global Forecast System (GFS), and to transition NCEP's mesoscale modeling suite to use FV3. In addition, NOAA/NWS is working with federal partners, universities, and the community to create a fully accessible FV3-based community model, see the <a href="https://github.com/ufs-community/ufs/wiki">UFS Community page</a> and the <a href="https://github.com/ufs-community/ufs-weather-model/wiki">UFS Weather Model</a> page on GitHub.</font></span></p>

<p align="left" style="margin-bottom: 0in; line-height: 150%">&nbsp;</p>

<p align="left" style="margin-bottom: 0in; line-height: 150%"><span style="font-family:arial,helvetica,sans-serif;"><font size="3" style="font-size: 12pt">The first implementation of the UFS Atmospheric model in NCEP occurred on June 12<sup>th</sup> 2019 with the implementation of GFS Version 15. The major component of this implementation was to replace the global spectral model in the GFS with the FV3 dynamical core. The operational FV3GFS runs the same physics as the previous GFS, except that the Zhao-Carr microphysics was replaced with the more advanced GFDL microphysics scheme.</font></span></p>

<p align="left" style="margin-bottom: 0in; line-height: 150%">&nbsp;</p>

<p align="left" style="margin-bottom: 0in; line-height: 150%"><span style="font-family:arial,helvetica,sans-serif;"><font size="3" style="font-size: 12pt">More details on the implementation of the GFS V15 with the FV3 dynamic core can be found in the <a href="https://www.weather.gov/media/notification/scn19-40gfs_v15_1.pdf">NWS Service Change Notice</a>, on <a href="https://vlab.noaa.gov/web/fv3gfs">EMC's FV3GFS page</a> on the NWS Vlab site. Comprehensive information on the official evaluation of GFS v15 is available at the EMC <a href="https://www.emc.ncep.noaa.gov/users/meg/fv3gfs/">Model Evaluation Groups web site</a>.</font></span></p>

<p align="left" style="margin-bottom: 0in; line-height: 150%">&nbsp;</p>

<p align="left" style="margin-bottom: 0in; line-height: 150%"><span style="font-family:arial,helvetica,sans-serif;"><font size="3" style="font-size: 12pt">On 23 September 2020, the global UFS application at NCEP was implemented in the Global Ensemble Forecast System (GEFS v12). The components of this upgrade include:</font></span></p>

<p align="left" style="margin-bottom: 0in; line-height: 150%">&nbsp;</p>

<ul type=disk>
<li> Use of the FV3 global model (same version as GFS v15) as the atmospheric component of GEFS
<li> Increase in horizontal resolution to ~25 km
<li> Forecast length increased from 10 to 16 days
<li> Increased from 21 to 31 members
<li> Coupling the GEFS atmospheric component to the NCEP Global Wave model
<li> Run a 32nd member to 5 days (GEFS-Aero) for aerosol prediction, inline aerosol representation based on GOCART (GSD-Chem).
</ul>

<p align="left" style="margin-bottom: 0in; line-height: 150%"><span style="font-family:arial,helvetica,sans-serif;"><font size="3" style="font-size: 12pt">This implementation is the first global-scale coupled system at NCEP, and will replace the existing standalone Global Wave Ensemble and the NEMS GFS Aerosol Component (NGAC). More details can be found at the EMC <a href="https://www.emc.ncep.noaa.gov/users/meg/gefsv12/">Model Evaluation Groups GEFS v12 web site</a>, the <a href="https://www.emc.ncep.noaa.gov/emc/pages/numerical_forecast_systems/gefs.php">EMC GEFS web page</a>, and the <a href="https://www.emc.ncep.noaa.gov/emc/pages/numerical_forecast_systems/gefs_aero.php">EMC GEFS-Aerosol web page</a>.</font></span></p>

<p>&nbsp;</p>

<p align="left" style="margin-bottom: 0in; line-height: 150%"><span style="font-family:arial,helvetica,sans-serif;"><font size="3" style="font-size: 12pt">On March 22, 2021, GFS version 16 was implemented in NCEP Operations. With this upgrade, NCEP is merging the operational global deterministic WAVEWATCH III wave model
Multi_1 into the GFS system. An updated version of the WAVEWATCH III model has been coupled to the GFS using a one-way
coupling scheme in which the atmospheric model provides forcing to the wave model using the NOAA Environmental Modeling System
(NEMS). Additional information can be found on the EMC Model Evaluation Groups <a href="https://www.emc.ncep.noaa.gov/users/meg/gfsv16/">GFS v16 website</a>, which includes numerous links
to presentations showing details on GFS v16 model/assimilation changes and performance evaluations.</font></span></p>

<p>&nbsp;</p>

<p><a id="TAB4"></a></p>

<p><span style="font-family:arial,helvetica,sans-serif;"><font size="4" style="font-size: 14pt">5) UFS at NCEP : Advancement toward a Convection-Allowing Ensemble System</font></span></p>

<p align="left" style="margin-bottom: 0in; line-height: 150%"><span style="font-family:arial,helvetica,sans-serif;"><font size="3" style="font-size: 12pt">As part of NCEPs commitment to move all atmospheric prediction components in the NCEP Production Suite (NPS) to use the UFS weather model, EMC has created the capability to run the FV3 model in a limited area configuration (*Black et al.,2021). Preliminary tests comparing 3 km forecasts nested within a global simulation with a limited area 3 km FV3 dynamic core over the CONUS have shown that the limited area FV3 produced statistically indistinguishable forecasts out to 60-h, was twice a fast, and used 50-75% fewer computational resources than the version nested within a global model.</font></span></p>

<p align="left" style="margin-bottom: 0in; line-height: 150%">&nbsp;</p>

<p align="left" style="margin-bottom: 0in; line-height: 150%"><span style="font-family:arial,helvetica,sans-serif;"><font size="3" style="font-size: 12pt">The initial implementation of the limited area FV3 in the NPS was made on May 11, 2021 in the <a href="https://www.emc.ncep.noaa.gov/emc/pages/numerical_forecast_systems/href-hiresw.php">High-Resolution Forecast System/HiResW</a>, with the HiResW-NMMB member of HREF replaced by a limited area FV3 member. This is a step towards the eventual implementation of the Rapid Refresh Forecast System (RRFS), a convection-allowing ensemble system having the following projected configuration:</font></span></p>

<p align="left" style="margin-bottom: 0in; line-height: 150%">&nbsp;</p>

<ul type=disk>
<li> Based on the limited area FV3 dynamic core
<li> Rapidly updated and convection-allowing (~3 km grid-spacing)
<li> Ensemble-based data assimilation
<li> Ensemble forecast
<li> 18 h forecast every hour
<li> 36-60 h forecast every 6 hours
</ul>

<p align="left" style="margin-bottom: 0in; line-height: 150%"><span style="font-family:arial,helvetica,sans-serif;"><font size="3" style="font-size: 12pt">The RRFS is intended to facilitate the replacement of current long-standing regional systems in the NPS: NAM/NAM nests, RAP/HRRR, and HiResW/HREF in the ~2024 timeframe.</font></span></p>

<p align="left" style="margin-bottom: 0in; line-height: 150%">&nbsp;</p>

<p align="left" style="margin-bottom: 0in; line-height: 150%"><span style="font-family:arial,helvetica,sans-serif;"><font size="3" style="font-size: 12pt">*Black, T. L., J. A. Abeles, B. T. Blake, D. Jovic, E. Rogers, X. Zhang, E. A. Aligo, L. C. Dawson, Y. Lin, E. Strobach, P. C. Shafran, and J. R. Carley, 2021: A Limited Area Modeling Capability for the Finite-Volume Cubed-Sphere (FV3) Dynamical Core and Comparison with a Global Two-Way Nest. <i>Journal of Advances in Modeling Earth Systems</i>, <b>13(6)</b>, <a href="https://doi.org/10.1029/2021MS002483">https://doi.org/10.1029/2021MS002483</a></font></span></p>

<p>&nbsp;</p>


